import React from 'react'
import './Home.css'
import 'bootstrap/dist/css/bootstrap.css'
import ButtonNext from '../../components/ButtonNext/ButtonNext';

function Home () {
    return (
        // {Navbar}
        <main class="border-0 d-flex flex-column justify-content-sm-between col-12 position-absolute fixed-top">
            <figure>
                <img src="http://placekitten.com/200/100"/>
            </figure>
            <section class="border-0 d-flex flex-column col-8">
                <ButtonNext href="/origem">Fazer um pedido</ButtonNext>
                <ButtonNext href="/origem">Falar com um consultor</ButtonNext> 
                {/* Abrir modal com informações básicas */}
            </section>
        </main>
    )
}

export default Home
